Here's a Ballerina program that prints numbers from 0 to 10:

```ballerina
import ballerina/io;

public function main() {
    int i;
    for i in 0..10 {
        io:println(i);
    }
}
```

**Explanation:**
1. The `import ballerina/io` statement imports the standard input/output library.
2. The `main` function is the entry point of the program.
3. The `for` loop uses the range `0..10` (inclusive of 0, exclusive of 11) to iterate through integers from 0 to 10.
4. Each iteration prints the current value of `i` using `io:println()`.

